webpackJsonp([0x82fca62728a6],{722:function(e,a){e.exports={data:{markdownRemark:{html:'<blockquote>\n<p>How about a nice game of chess?</p>\n</blockquote>\n<p>As a child, I always wanted to be a hacker. I remember the first time my father showed me how to <code>dir /p</code>. I thought I was hacking the planet. Then I grew up, and I realized the reality of it was a bit different. I still use the CLI all the time, but it&#x2019;s far less glamorous in daily use than it had been portrayed in film &amp; media during my childhood.</p>\n<p>\n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; z-index: 0 !important;; max-width: 728px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 56.18131868131868%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px transparent;" alt="6568 1" title="" src="/static/6568_1-56055ba782da07df49531ae07b464875-c80a9.jpg" srcset="/static/6568_1-56055ba782da07df49531ae07b464875-7d16c.jpg 200w,\n/static/6568_1-56055ba782da07df49531ae07b464875-50080.jpg 400w,\n/static/6568_1-56055ba782da07df49531ae07b464875-c80a9.jpg 728w" sizes="(max-width: 728px) 100vw, 728px">\n    </span>\n  </span>\n  </p>\n<p>But that doesn&#x2019;t mean we still can&#x2019;t have fun. I needed some command line nostalgia in my life, so I made it happen and I&#x2019;m here to introduce Webpack Dashboard.</p>\n<p>If you use webpack with regularity, specifically the <code>webpack-dev-server</code> or <code>webpack-dev-middleware</code>, you are probably used to seeing something like this:</p>\n\n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; z-index: 0 !important;; max-width: 663px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 75.41478129713424%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px transparent;" alt="webpack dev server" title="" src="/static/webpack-dev-server-11763878dcd2eb2526382108d415de6f-19783.png" srcset="/static/webpack-dev-server-11763878dcd2eb2526382108d415de6f-e1f31.png 200w,\n/static/webpack-dev-server-11763878dcd2eb2526382108d415de6f-e20d8.png 400w,\n/static/webpack-dev-server-11763878dcd2eb2526382108d415de6f-19783.png 663w" sizes="(max-width: 663px) 100vw, 663px">\n    </span>\n  </span>\n  \n<p>Now don&#8217;t get me wrong, its a great collection of information, but I&#8217;ve always found it to be hard to derive any useful information from it without waiting for it to finish and then scrolling upwards until I could find the information I wanted.</p>\n<p>A while back, I came across a library called <a href="https://github.com/chjj/blessed">blessed</a>, that lets you easily create command line interfaces for things like dashboards. I had tinkered with it, but didn&#8217;t really have a great dashboard idea. Until now. I realized this sort of thing would actually really help organize and intuitively display dev server output, so I created <code>webpack-dashboard</code>. Here is what your dev server output can look like now:</p>\n\n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; z-index: 0 !important;; max-width: 800px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 58.30437804030576%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px transparent;" alt="Screen Shot 2016 08 14 at 2 17 27 PM" title="" src="/static/Screen-Shot-2016-08-14-at-2.17.27-PM-ce4939ff7e07cdd503e52b6067fd908b-fc76f.png" srcset="/static/Screen-Shot-2016-08-14-at-2.17.27-PM-ce4939ff7e07cdd503e52b6067fd908b-290b0.png 200w,\n/static/Screen-Shot-2016-08-14-at-2.17.27-PM-ce4939ff7e07cdd503e52b6067fd908b-14201.png 400w,\n/static/Screen-Shot-2016-08-14-at-2.17.27-PM-ce4939ff7e07cdd503e52b6067fd908b-fc76f.png 800w,\n/static/Screen-Shot-2016-08-14-at-2.17.27-PM-ce4939ff7e07cdd503e52b6067fd908b-0fcde.png 1200w,\n/static/Screen-Shot-2016-08-14-at-2.17.27-PM-ce4939ff7e07cdd503e52b6067fd908b-41993.png 1439w" sizes="(max-width: 800px) 100vw, 800px">\n    </span>\n  </span>\n  \n<p>Check it out in action:</p>\n<img src="http://i.imgur.com/T23r06q.gif" alt="">\n<p>For the initial release, we have the following features:</p>\n<ul>\n<li><strong>Log:</strong> Logs errors from the build process</li>\n<li><strong>Status:</strong> The status of the build process</li>\n<li><strong>Operation:</strong> The specific operation taking place in the build process</li>\n<li><strong>Progress:</strong> Live build progress</li>\n<li><strong>Modules:</strong> A list of your modules, their sizes and percentage of bundle size</li>\n<li><strong>Assets:</strong> A list of assets output from the build</li>\n</ul>\n<p>So if you want to give it a spin, head on over to:</p>\n<p><a href="https://github.com/FormidableLabs/webpack-dashboard">https://github.com/FormidableLabs/webpack-dashboard</a></p>\n<div>\n          <div\n            class="gatsby-resp-iframe-wrapper"\n            style="padding-bottom: 9.090909090909092%; position: relative; height: 0; overflow: hidden;"\n          >\n            <iframe src="https://ghbtns.com/github-btn.html?user=formidablelabs&amp;repo=webpack-dashboard&amp;type=star&amp;count=true&amp;size=large" frameborder="0" scrolling="0" style="\n            position: absolute;\n            top: 0;\n            left: 0;\n            width: 100%;\n            height: 100%;\n          "></iframe>\n          </div>\n          </div>\n<div>\n          <div\n            class="gatsby-resp-iframe-wrapper"\n            style="padding-bottom: 9.090909090909092%; position: relative; height: 0; overflow: hidden;"\n          >\n            <iframe src="https://ghbtns.com/github-btn.html?user=kenwheeler&amp;type=follow&amp;count=true&amp;size=large" frameborder="0" scrolling="0" style="\n            position: absolute;\n            top: 0;\n            left: 0;\n            width: 100%;\n            height: 100%;\n          "></iframe>\n          </div>\n          </div>',fields:{slug:"/blog/2016/08/15/introducing-webpack-dashboard/"},frontmatter:{id:20,authorId:9,categoryIds:[5,6],date:"2016-08-15",pageDescription:"Introducing Webpack Dashboard, a CLI dashboard for your webpack-dev-server",pageKeywords:"webpack, blessed, CLI, dashboard, webpack-dev-server, webpack-dashboard, terminal",pageTitle:"",path:"/2016/08/15/introducing-webpack-dashboard/",title:"Introducing Webpack Dashboard"}}},pathContext:{slug:"/blog/2016/08/15/introducing-webpack-dashboard/",prev:{fields:{slug:"/blog/2016/08/05/announcing-victory-0-10-2-and-victorynative/"},frontmatter:{authorId:3,categoryIds:[10,5,1,8],date:"2016-08-05",id:19,title:"Announcing Victory 0.10.2 and VictoryNative"}}}}}});